description:
Jenna ar 13 ar och drommer om det glamourosa vuxenlivet. Pa sin 
fodelsedag far hon sin oskyldiga onskan uppfylld och vaknar dagen 
darpa i en trettioarings kropp. Men som vuxen upptacker hon att 
livet hon efterstravat kanske inte riktigt var det hon onskat sig. Och 
att vanner och ovanner inte alltid ar de man vantar sig.
Med Jennifer Garner, Mark Ruffalo, Judy Greer m fl.

Filmen har inbrand svensk text.
